import React from "react";

class New extends React.Component{
    constructor(props){
        super(props)
        this.createChore = this.createChore.bind(this)    
    }
    createChore(e){
        let newChore = e.target.value;
        console.log(newChore);
    }
    render(){
        return(
            <form onClick={this.createChore}>
                <input type="text" placeholder="Add new"></input>
                <button>Submit</button>
            </form>
        )
    }
}

export default New
